import DoacaoForm from "./pages/doacao/DoacaoForm";

function App() {
  return (
    <Router>
      <div style={{ padding: "30px", fontFamily: "Segoe UI, sans-serif", maxWidth: "1000px", margin: "auto" }}>
        <header style={{ marginBottom: "40px", borderBottom: "2px solid #c0392b" }}>
          <h1 style={{ color: "#c0392b" }}>ü©∏ Banco de Sangue</h1>
          <p style={{ fontStyle: "italic" }}>
            Sistema completo para gerenciamento de doadores, hospitais, solicita√ß√µes e estoque de sangue.
          </p>
        </header>

        {/* Menu */}
        <nav style={{ marginBottom: "40px" }}>
          <section>
            <h3>üîπ Doadores</h3>
            <Link to="/doadores">üìã Listar</Link> |{" "}
            <Link to="/doadores/novo">‚ûï Cadastrar</Link>
          </section>
          <section>
            <h3>üè• Hospitais</h3>
            <Link to="/hospitais">üìã Listar</Link> |{" "}
            <Link to="/hospitais/novo">‚ûï Cadastrar</Link>
          </section>
          <section>
            <h3>üßë‚Äçüíº Gerentes</h3>
            <Link to="/gerentes">üìã Listar</Link> |{" "}
            <Link to="/gerentes/novo">‚ûï Cadastrar</Link>
          </section>
          <section>
            <h3>üìë Solicita√ß√µes de Bolsas</h3>
            <Link to="/solicitacoes">üìã Listar</Link> |{" "}
            <Link to="/solicitacoes/novo">‚ûï Solicitar Bolsas</Link>
          </section>
          <section>
            <h3>üì¶ Estoque</h3>
            <Link to="/estoque">üìã Ver Estoque</Link> |{" "}
            <Link to="/estoque/novo">‚ûï Adicionar Manualmente</Link>
          </section>
          <section>
            <h3>‚öôÔ∏è Funcionalidades</h3>
            <Link to="/doacoes">‚úÖ Registrar Doa√ß√£o</Link>
          </section>
        </nav>

        {/* Rotas */}
        <Routes>
          {/* Doadores */}
          <Route path="/doadores" element={<DoadorList />} />
          <Route path="/doadores/novo" element={<DoadorForm />} />

          {/* Hospitais */}
          <Route path="/hospitais" element={<HospitalList />} />
          <Route path="/hospitais/novo" element={<HospitalForm />} />

          {/* Gerentes */}
          <Route path="/gerentes" element={<GerenteList />} />
          <Route path="/gerentes/novo" element={<GerenteForm />} />

          {/* Solicita√ß√µes */}
          <Route path="/solicitacoes" element={<SolicitacaoList />} />
          <Route path="/solicitacoes/novo" element={<SolicitacaoForm />} />

          {/* Estoque */}
          <Route path="/estoque" element={<EstoqueList />} />
          <Route path="/estoque/novo" element={<EstoqueForm />} />

          {/* Registro de Doa√ß√µes */}
          <Route path="/doacoes" element={<DoacaoForm />} />

          {/* P√°gina Inicial */}
          <Route path="/" element={<h2>üî¥ Bem-vindo ao Sistema de Banco de Sangue!</h2>} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
